import React from "react";
import NewExpenseItem from './components/Expenses/NewExpenseItem';
import NewExpense from "./components/NewExpense/NewExpense";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={
            <>
              <NewExpense />
              <NewExpenseItem />
            </>
          } />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
